/***********************************************************************************************
CREATE TABLE: RAPS_SPECIALTY_CODES

Notes:
--The purpose of this code is to create a table with the list of acceptable physician specialty codes for RAPS risk adjustment data submission
--I am creating one table with the list of specialty codes for each year. As such, one specialty code could be/is in the table multiple times. I am doing it this way
to make it easier to validate the number of codes each year (just do a count by year). Also, this should make it more accurate when joining to claims tables
because you will need to join the two tables based on year(claim date) and calendar year as well as the code. Whereas, if you only had to join based on code,
it is possible you could forget to limit to just the codes in a certain year.
--All of these tables are from the CSSC Operations webiste:
https://www.csscoperations.com/internet/cssc4.nsf/docsCat/CSSC~CSSC%20Operations~Medicare%20Advantage%20Encounter%20Data%20and%20RAPS%20Data~Resources?open&expand=1&navmenu=Medicare^Advantage^Encounter^Data^and^RAPS^Data||
--I did not include the specialty code description.
--I am adding in a column titled 'CY' (Calendar Year) to try to make this table more like the EDS table. My intention is for this to be the same thing as 
claim year. So for risk adjustment purposes, CY=2018 means claims with dates of service in 2018 which would be used to calculate risk scores for payment year 2019.
--Specialty codes for payment year 2020, dates of service in 2019 have yet to be published as of 4/18/19 so I am using payment year 2019 as a placeholder.

***********************************************************************************************/

IF OBJECT_ID('dbo.RAPS_SPECIALTY_CODES', 'U') IS NOT NULL DROP TABLE dbo.RAPS_SPECIALTY_CODES
CREATE TABLE dbo.RAPS_SPECIALTY_CODES     (CODE VARCHAR(2), CY FLOAT)

