/***********************************************************************************************
CREATE TABLE: MEDICARE_CPT_HCPCS_LIST

Notes:
--The purpose of this code is to create a table with the list of risk adjustment eligible CPT/HCPCS codes CMS publishes for EDS processing.
--I am creating one table with the list of CPT/HCPCS codes for each year. As such, one code could be in the table multiple times. I am doing it this way
to make it easier to validate the number of codes each year (just do a count by year). Also, this should make it more accurate when joining to claims tables
because you will need to join the two tables based on year(claim date) and calendar year as well as the code. Whereas, if you only had to join based on code,
it is possible you could forget to limit to just the codes in a certain year.
--All of these tables are from the CMS webiste:
https://www.cms.gov/Medicare/Health-Plans/MedicareAdvtgSpecRateStats/Risk-Adjustors-Items/CPT-HCPCS.html
--For the data field titles, I am using the titles CMS uses. Don't @ me.
--It is my understanding that 'CY' (Calendar Year) is the same thing as claim year. So for risk adjustment purposes, CY=2018 means claims with dates of service 
in 2018 which would be used to calculate risk scores for payment year 2019.
--It is also my understanding that the final list for each calendar year is published in Q4 of that year. Since the list in Q1 of a particular calendar year
will not necessarily match the final list published in Q4, it is your reponsibliity to update/check back at the end of the year to get the final list.
***********************************************************************************************/

IF OBJECT_ID('dbo.MEDICARE_CPT_HCPCS_LIST', 'U') IS NOT NULL DROP TABLE dbo.MEDICARE_CPT_HCPCS_LIST
CREATE TABLE dbo.MEDICARE_CPT_HCPCS_LIST     (HCPCS_CPT_CODE VARCHAR(5), SHORT_DESCRIPTION VARCHAR(30), CY FLOAT)

